import logo from './logo.svg';
import './App.css';
import Main from './components/Main'
import Login from './components/Login';

function App() {

  const firstView = () => {
    if (true){
      return <Main/>
    } else {
      return <Login/>
    }
  }


  return (
    <div className="App">
      <header className="App-header">
        {this.firstView}
      </header>
    </div>
  );
}

export default App;
